import img14 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/14.jpg';
import img15 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/15.jpg';
import img16 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/16.jpg';

const jssStyle = theme => ({
    img: {
      display: 'block',
      marginLeft: 'auto',
      marginRight: 'auto',
      marginBottom: '30px',
      marginTop: '30px',
      maxWidth: '90%'
    },
    blockQuote: {
      background: '#f9f9f9',
      borderLeft: '10px solid #ccc',
      margin: '1.5em 10px !important',
      padding: '0.5em 10px',
      display: 'block',
      quotes: `'"''"''"''"'`,
      '&::before': {
        color: '#ccc',
        content: 'open-quote',
        fontSize: '4em',
        lineHeight: '0.1em',
        marginRight: '0.25em',
        verticalAlign: '-0.4em'
      }
    },
    center: {
        textAlign: 'center'
    }
})

const ImprovingYourAppTodaysTopEarningAppCharacteristics = (props) => {
  const {classes} = props;
  return (
    <div>
        <Typography variant="h4" className={classes.center} gutterBottom>Apple App Store</Typography>
        <img src={img1} className={classes.img} alt='Top grossing iPhone apps'/>
        <Typography className={classes.center}><strong>NOTE: </strong>Underlined titles signify an app that shares a top spot across both major app stores.</Typography>
        <Typography variant="h6" gutterBottom>Gaming:</Typography>
        <Typography paragraph>Mobile Strike</Typography>
        <Typography paragraph>Clash of Clans</Typography>
        <Typography paragraph>Game of War - Fire Age</Typography>
